import React, { useEffect } from 'react'
import { useNavigate } from 'react-router-dom'

function Home(props) {
    const navigate = useNavigate();

    useEffect(() => {
        const token = localStorage.getItem('TOKEN');
        if (!token) {
            navigate('/signin');
        }
    })
    return (
        <div class='navbar navbar-expand-lg bg-body-tertiary container'>
        <div class='container-fluid d-flex justify-content-between'>
            <div class='d-flex'>
                <h2>Application</h2>
                
            </div>
            <div className='justify-content-between'>
                <span>{'df'}</span>
                <button class="btn btn-outline-primary ml-3">LOGOUT</button>
            </div>
        </div>
    </div>
            )
}

            export default Home
